import React from "react"
import { Card } from "react-bootstrap";

const Page = () => {
    return (
        <div className="container mt-4">
            <Card>
                <Card.Img variant="top" src={bookDetails.image} alt={bookDetails.bookName} />
                <Card.Body>
                    <Card.Title>{bookDetails.bookName}</Card.Title>
                    <Card.Text>
                        <strong>Authors:</strong> {bookDetails.authors.join(', ')}
                    </Card.Text>
                    <Card.Text>
                        <strong>Description:</strong> {bookDetails.description}
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
};


export default Page;
